import { useReducer } from "react";
import "./App.css";
import Checkout from "./Checkout";
import { initialState, ProductsContext } from "./slicer/Context";
import { reducer } from "./slicer/Store";

function App() {
  const [state, despatch] = useReducer(reducer, initialState);
  const value = {
    products: initialState.products,
    showLoadingState: initialState.showLoadingState,
    orederedProducts: initialState.orederedProducts,

  };
  return (
    <div className="App">
      <ProductsContext.Provider value={value}>
        <Checkout />
      </ProductsContext.Provider>
    </div>
  );
}

export default App;
